import React, {Fragment, useState} from 'react';
import './App.css';
import About from './components/About/About';
import Bookings from "./components/Bookings/Bookings";
import FooterContact from "./components/Footer/FooterContact";
import Honeycomb from "./components/Honeycomb/Honeycomb";
import Navigation from "./components/Navigation/Navigation";
import Announcements from "./components/Announcements/Announcements";


function App() {

const [currentPage, handlePageChange] = useState('Home');


const renderPage = () => {
    switch(currentPage) {
        case 'About' :
            return <About/>;

        case 'Services' :
            return <Announcements />

        default:
        return <Honeycomb currentPage = {currentPage} handlePageChange={handlePageChange}/>
    }
}
    return (

        <Fragment>
            <Navigation currentPage = {currentPage} handlePageChange = {handlePageChange} />

            <body>
            <h1 className={`mainHeader text-dark ff-serif-bold fs-800`}>Bee Better Massage </h1>
            <div className='hero'>

                <Bookings/>

</div>
            {renderPage(currentPage)}

            <Honeycomb/>
            <FooterContact/>
            <About/>
            </body>
        </Fragment>


    )
}

export default App;
